import React, { Component } from 'react';
import InfoCard from './InfoCard'
import { Link } from 'react-router-dom'
import Transition from 'react-transition-group/Transition';
//import { isAbsolute } from 'path';

class Main extends Component {
  state = {
    isLoading: true,
    guide: { left: '36%', top: '34%',},
    sign: {left: '36%', top: '34%',},
    speech: {left: '36%', top: '34%',},
    transport: {left: '36%', top: '34%',},
    homeSick: {left: '36%', top: '34%',},
  };
  
  componentDidMount() {
      this.setState({
          isLoading: false,
        })
  }
  render() {
    if(this.state.isLoading){
      return <div>is Loading . . .</div>
  }
    
  
    const guideImage = 'data:image/svg+xml;base64,';
    const transportImage = 'data:image/svg+xml;utf8;base64,'
    const homeSickImage = 'data:image/svg+xml;utf8;base64,'
    return (
      <section className="main">
        <h1>traveleez</h1>
      <Transition timeout={4000} in={true} appear>
      {(status) =>(

        <Link to="/guides-list" className={`guide-icon guide-icon-${status}`} >
          <InfoCard classname={`guide-icon guide-icon-${status}`} img={guideImage}>Guides</InfoCard>
        </Link>
      )}
      </Transition>
      <Transition timeout={4000} in={true} appear>
      {(status) =>(
        <Link to="/scan" className={`guide-icon guide-icon-${status}`}>
          <InfoCard img="data:image/svg+xml;utf8;base64,">Sign</InfoCard>
        </Link>
      )}
        </Transition>
        <Transition timeout={4000} in={true} appear>
      {(status) =>(
        <Link to="/speech" className={`translate-icon translate-icon-${status}`}>
          <InfoCard img="data:image/svg+xml;utf8;base64,">Translate</InfoCard>
        </Link>
      )}
       </Transition>
       <Transition timeout={4000} in={true} appear>
      {(status) =>(
        <Link to="/transport" className={`translate-icon translate-icon-${status}`}>
          <InfoCard img={transportImage}>Transport</InfoCard>
        </Link>
      )}
      </Transition>
      <Transition timeout={4000} in={true} appear>
      {(status) =>(
        <Link to="/homesick" className={`translate-icon translate-icon-${status}`}>
          <InfoCard img={homeSickImage}>Homesick</InfoCard>
        </Link>
      )}
      </Transition>
      </section>

    );
  }
}
 export default Main; 
